package db.domain;import java.util.Arrays;public class MissionChallengeImpl implements MissionChallenge {	@Key	private String uname;	@Key	private int missionId;	private boolean branchIsCross;	private boolean mainIsCross;	public MissionChallengeImpl() {	}	public MissionChallengeImpl(MissionChallenge c) {		this.uname = c.getUname();		this.missionId = c.getMissionId();		this.branchIsCross = c.getBranchIsCross();		this.mainIsCross = c.getMainIsCross();	}	@Override	public String tableName() {		return "mission_challenge";	}	public void setUname(String uname) {		this.uname = uname;	}	public String getUname() {		return this.uname;	}public void addUname(String uname) {		this.uname += uname;}	public void setMissionId(int missionId) {		this.missionId = missionId;	}	public int getMissionId() {		return this.missionId;	}public void addMissionId(int missionId) {		this.missionId += missionId;}	public void setBranchIsCross(boolean branchIsCross) {		this.branchIsCross = branchIsCross;	}	public boolean getBranchIsCross() {		return this.branchIsCross;	}	public void setMainIsCross(boolean mainIsCross) {		this.mainIsCross = mainIsCross;	}	public boolean getMainIsCross() {		return this.mainIsCross;	}}